import React, { useEffect, useState } from 'react';
import {connect} from 'react-redux'
import { useNavigate } from 'react-router-dom'
import { Container, Button1, GlobalStyle } from '../elements/global';
import * as Element from '../elements/formpages';
import Banner from './Banner';
import { register } from '../actions/auth';
import CSRFToken from '../components/CSRFToken';

const SignUp = ({isAuthenticated, register}) => {
  const navigate = useNavigate();

  useEffect(() => {
    if (isAuthenticated)
      navigate('/mainScreen');
  }, [isAuthenticated, navigate]);

  const [formData, setFormData] = useState({
    email: '',
  });

  const {email} = formData;

  const onChange = e => setFormData({ ...formData, [e.target.name]: e.target.value });

  const onSubmit = e => {
    e.preventDefault();

    register(email);
    navigate('/');
  }

  return (
    <React.Fragment>
    <GlobalStyle />
    <Container>
        <Element.LoginForm onSubmit={e => onSubmit(e)}>
          <Banner origin="SignUp"></Banner>
          <Element.HorizontalSeparator>
          <Element.LeftSideImage></Element.LeftSideImage>
          <CSRFToken />
          <Element.LoginFormDiv>
            <Element.StandardDiv>
              <Element.Input
                type="text"
                placeholder="Email..."
                name="email"
                onChange={e => onChange(e)}
                value={email}
                required
              />
            </Element.StandardDiv>
            <label>After registering, you will be</label>
            <label>redirected to the homepage and a mail</label>
            <label>with your initial password will be sent.</label>
          <Element.StandardDiv>
            <Element.ComingSoon>
              <div className={"styles.comingSoonText"}>Coming soon!</div>
              <Element.StandardDiv>
                <Button1 disabled>
                  Log in with Google
                </Button1>
              </Element.StandardDiv>
              <Element.StandardDiv>
                <Button1 disabled>
                  Log in with Apple
                </Button1>
              </Element.StandardDiv>
            </Element.ComingSoon>
          </Element.StandardDiv>
            <Element.FlattenedButton>Sign up</Element.FlattenedButton>
            </Element.LoginFormDiv>
          </Element.HorizontalSeparator>
        </Element.LoginForm>
      </Container>
    </React.Fragment>
  );
}

const mapStateToProps = state => ({
  isAuthenticated: state.auth.isAuthenticated
})

export default connect(mapStateToProps, { register })(SignUp);
